import React from 'react'
import NavBar from '../Nav/Nav'
import { Outlet } from "react-router-dom";



class Layout extends React.Component{

  state = {
    languages : [
        {   
            lang : "English",
            langFirst: "Turkish",
            langSecond: "English",
            donate: "Support Us",
            about: "About",
            contact: "Contact",
            languageTitle: "Language"
        },
        {
            lang : "Turkish",
            langFirst: "Türkçe",
            langSecond: "İnglizce",
            donate: "Destek Ol",
            about: "Hakkımızda",
            contact: "İletişim",
            languageTitle: "Dil"
        }
    ],

    language: "English"
}

  render(){
    return (
      <div>
          <NavBar/>

          <div>
              <Outlet/>
          </div>
      </div>
    );
  }
}

export default Layout
